// Tests for bindFavoriteButton
test('bindFavoriteButton: local storage is updated with recipe', () => {
  document.body.innerHTML = `
    <div class = "col-md-3">
        <button class = "btn btn-success rounded-pill float-end add-to-myrecipes">Add to Recipe</button>
    </div>
  `
  require('../scripts/RecipeExpandBootstrap.js')

  const localStorage = window.localStorage
  localStorage.clear()
  expect(localStorage.length).toBe(0)
  const sessionStorage = window.sessionStorage
  sessionStorage.setItem(recipeData1.id, recipeData1)
  sessionStorage.setItem('curr', recipeData1.id)
  document.querySelector('.add-to-myrecipes').addEventListener('click', functions.bindFavoriteButton)
  document.querySelector('.add-to-myrecipes').click()
  expect(localStorage.length).toBe(1)
})

test('bindFavoriteButton: button inner HTML changes', () => {
  expect(document.querySelector('.add-to-myrecipes').innerHTML).toBe('Remove from MyRecipes')
})

test('backToSearch: location url changes', () => {
  window.onpopstate = function (event) {
    console.log('location: ' + document.location + ', state: ' + JSON.stringify(event.state))
  }
  history.pushState({ page: 1 }, 'title 1', '?page=1')
  history.pushState({ page: 2 }, 'title 2', '?page=2')

  const state1 = window.location.href

  functions.backToSearch()
  setTimeout(() => {
    console.log('timeout')
  }, 1000000000)

  const state2 = window.location.href
  expect(state1 === state2).toBe(false)
})

